import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 24.2-667.1 Reporting of results; absentee votes.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/24.2-667.1.md","filePath":"vacode/24.2-667.1.md"}'),s={name:"vacode/24.2-667.1.md"},o=r('<h1 id="§-24-2-667-1-reporting-of-results-absentee-votes" tabindex="-1">§ 24.2-667.1 Reporting of results; absentee votes. <a class="header-anchor" href="#§-24-2-667-1-reporting-of-results-absentee-votes" aria-label="Permalink to &quot;§ 24.2-667.1 Reporting of results; absentee votes.&quot;">​</a></h1><p>The general registrar shall report to the Department for each precinct in his locality the number and results of absentee ballots cast by voters assigned to such precinct. Results from absentee voting and voting at the precinct on election day shall be reported separately. The general registrar shall also report to the Department of Elections the number and results of absentee ballots cast early in person pursuant to § <a href="/vacode/24.2-701.1/">24.2-701.1</a> separately from the number and results of all other absentee ballots. The Department shall establish standards for ascertaining and reporting such information.</p><p>2021, Sp. Sess. I, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?212+ful+CHAP0471" target="_blank" rel="noreferrer">471</a>; 2022, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0125" target="_blank" rel="noreferrer">125</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?221+ful+CHAP0126" target="_blank" rel="noreferrer">126</a>.</p>',3),n=[o];function l(i,c,p,h,f,_){return t(),a("div",null,n)}const b=e(s,[["render",l]]);export{g as __pageData,b as default};
